// src/App.tsx
import React from 'react';
import FirmFacts from './components/FirmFacts/FirmFacts';
import Button from './components/Button/Button';
import './App.css';

const App: React.FC = () => {
  return (
    <div className="App">
      <FirmFacts />
      <div className="mt-6">
        <Button label="Default Button" />
        <Button label="Icon Button" variant="icon" />
        <Button label="Disabled Button" disabled={true} />
      </div>
    </div>
  );
}

export default App;
